import React from 'react';
import logo from './logo.svg';
import './App.css';
import StatiquePage from './StatiquePage';
import Dashbord from './Dashbord';
import Tables from './Tables';
import Login from './Login';
import { AppRoute } from './AppRoute'
import { Link, BrowserRouter as Router, Route, Switch, withRouter } from 'react-router-dom'

function App() {
  return (
    <Router>
      <Switch>
        <AppRoute path='/Dashbord' component={Dashbord} layout={StatiquePage}></AppRoute>
        <AppRoute path='/Tables' component={Tables} layout={StatiquePage}></AppRoute>
        <Route path="/" render={() => <Login />} />
      </Switch>
    </Router>
  );
}

export default App;
